import React from 'react'
import {
	StyleSheet,
	Text,
	View,
	Image,
	TouchableWithoutFeedback,
	StatusBar,
	SafeAreaView,
	Keyboard,
	TouchableOpacity,
	KeyboardAvoidingView,
	Dimensions,
	TouchableHighlight,
} from "react-native";

const UserRegistration = () => {
  return (
    <View>Hello registration</View>
  )
}

export default UserRegistration
